window.bookSummaryJSON = "<p>What happens when your rumored name destroys your life? When the very runes engraved on your skin since birth are a death sentence? </p> <p>Evie doesn't remember a life before she was on the streets, a life before thieving to live and killing to stay alive. When a royal family she didn't know anything about goes missing, Evie finds herself thrown into the royal court of the protectors, and they demand her help. Help in exchange for a chance at freedom and the name that's haunted her, forgotten. A name she can’t even read, a name she doesn’t understand. </p> <p>But with three Royal protectors tasked with helping her, her demon ex, who is literally from hell, stalking her...will Evie ever be free?</p>"; 
